import React from 'react';
import Card from './Card';

export default function Cards(props) {
  // acá va tu código
  // tip, podés usar un map
  return (
    <>
      <div>Cards Component</div>
      {
      props.cities.map( citi => (
      <div className="cities">
        <Card 
          name={citi.name}
          min={citi.min}
          max={citi.max}
          onClose={citi.onClose}
        />
      </div>

      )
      )
      }

    </>
  )
};
